import React, { Component } from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';

class App extends Component {
  render() {
    return (
      <div className="landing">
      	< Navbar />
        <h1>
        My React App
        </h1>



      <div className="footer">
        <Footer />
      </div> </div>
    );
  }
}
export default App;
